||unistr('\03AD\03BD\03B7 \03B1\03BD\03B1\03C6\03BF\03C1\03AC). \039C\03C0\03BF\03C1\03B5\03AF\03C4\03B5 \03BD\03B1 \03B1\03C0\03BF\03B8\03B7\03BA\03B5\03CD\03C3\03B5\03C4\03B5 \03C4\03AD\03C3\03C3\03B5\03C1\03B9\03C2 \03C4\03CD\03C0\03BF\03C5\03C2 \03B4\03B9\03B1\03B4\03C1\03B1\03C3\03C4\03B9\03BA\03CE\03BD \03B1\03BD\03B1\03C6\03BF\03C1\03CE\03BD:</p>'),
'<ul>',
unistr('<li><strong>\039A\03CD\03C1\03B9\03B1 \03C0\03C1\03BF\03B5\03C0\03B9\03BB\03B5\03B3\03BC\03AD\03BD\03B7</strong> (\039C\03CC\03BD\03BF \03C0\03C1\03BF\03B3\03C1\03B1\03BC\03BC\03B1\03C4\03B9\03C3\03C4\03AD\03C2). \03A0\03C1\03CC\03BA\03B5\03B9\03C4\03B1\03B9 \03B3\03B9\03B1 \03C4\03BF\03BD \03C4\03CD\03C0\03BF \03C4\03B7\03C2 \03B1\03BD\03B1\03C6\03BF\03C1\03AC\03C2 \03C0\03BF\03C5 \03B5\03BC\03C6\03B1\03BD\03AF\03B6\03B5\03C4\03B1\03B9 \03B1\03C1\03C7\03B9\03BA\03AC. \0397 \03BC\03B5\03C4\03BF\03BD\03BF\03BC\03B1\03C3\03AF\03B1 \03AE \03B7 \03B4\03B9\03B1\03B3\03C1\03B1\03C6\03AE \03C4\03C9\03BD \03BA\03CD\03C1\03B9\03C9\03BD \03C0\03C1\03BF\03B5\03C0\03B9\03BB\03B5\03B3\03BC\03AD\03BD\03C9\03BD \03B1\03BD\03B1\03C6\03BF\03C1\03CE\03BD \03B4\03B5\03BD \03B5\03AF\03BD\03B1\03B9 \03B4\03C5\03BD\03B1\03C4\03AE.</li>'),
